import "./header.css";
import Navbar from "./Navbar";
import Slider from "react-slick";
import pic1 from "../img/pic1.jpg";
import pic2 from "../img/pic2.jpg";
export default function Header() {
  
    const settings = {
      dots : false,
      infinite : false,
      speed : 500,
      slidesToShow : 1,
      slidesToScroll : 1
    };
  
  return (
    <div classname="navbar">
      <Navbar></Navbar>
      <div className="header">
        <div className="headerTitles">
          <span className="headerTitle">Choi WooSun</span>
        </div>
        <Slider {...settings}>
        <div>
        <img
          
          src="https://gearbox.imgix.net/https%3A%2F%2Fix-www.imgix.net%2Fsolutions%2Fbeach.jpg?w=1782&h=982&fit=crop&ixlib=js-2.0.0&s=696f7285735b866832b0d79abb471548"
          alt=""
        ></img>
        </div>
        <div>
        <img
          
          src={pic1}
          alt=""
        ></img>
        </div>
        <div>
        <img
          
          src={pic2}
          alt=""
        ></img>
        </div>
        </Slider>
      </div>
    </div>
  );
  }
